    //     {
    //       key: '3',
    //       firstName: 'Joe',
    //       lastName: 'Black',
    //       age: 32,
    //       address: 'Sidney No. 1 Lake Park',
    //       tags: ['cool', 'teacher'],
    //     },
    //   ];


    return (

            <Table>
               {user.map((users) => (
               <tr>
               <td>key={users.id}</td>
               <td>Maria Anders</td>
               <td>Germany</td>
             </tr>
               ))}
            </Table>

    )
}

export default Blogs
